import React from "react";
import "../components/header.css"
// import topLink from './Data'
function Header () {
  const topLink = [
    {
      linkTitle: "Dashboard",
      linkURL: "/admin",
    },
    {
      linkTitle: "Starred",
      linkURL: "/admin",
    },
    {
      linkTitle: "Send email",
      linkURL: "/admin",
    },
    {
      linkTitle: "Drafts",
      linkURL: "/admin",
    },
  ]
  const planSection = [

    {
      linkTitle: "Vision, Values & Mission",
      linkURL: "/admin",
    },
    {
      linkTitle: "Financial Measures",
      linkURL: "/admin",
    },
    {
      linkTitle: "Our Offer",
      linkURL: "/admin",
    },
    {
      linkTitle: "Pest Analysis",
      linkURL: "/admin",
    },
    {
      linkTitle: "Swot Analysis",
      linkURL: "/admin",
    },
    {
      linkTitle: "Goals & Objectives",
      linkURL: "/admin",
    },
    {
      linkTitle: "Strategies",
      linkURL: "/admin",
    },
    {
      linkTitle: "Section 9",
      linkURL: "/admin",
    },
    {
      linkTitle: "Section 10",
      linkURL: "/admin",
    },
  ]
  return (
      <div className="sidenav">
          {topLink.map((item)=>
            <a href='/' key={item.id}>{item.linkTitle}</a>
          )}
      </div>
  );
}

export default Header;
